import React from 'react';
import './Sidebar.css';

function Sidebar({ onCreateScenario, onCreateVehicle }) {
  return (
    <div className="sidebar">
      <h2>Menu</h2>
      <ul>
        <li><button onClick={onCreateScenario}>Create Scenario</button></li>
        <li><button onClick={onCreateVehicle}>Create Vehicle</button></li>
      </ul>
    </div>
  );
}

export default Sidebar;
